    public async Task FindCenters()
    {
        if (flag)
        {
            flag = false;
        }
        slotResponse = new SlotResponse();
        flag = true;
        flagSlot = true;
        slotResponse.slot = new List<slot>();

        var tempValue = datetime.ToString("dd/MM/yyyy");
        date = tempValue;
        
        var dateinp = date;
        if (string.IsNullOrEmpty(date))
        {
            dateinp = "nothing";
